INSERT INTO `block_custom` VALUES (1,'<p>Chính phủ vừa ban hành Nghị định 47/2017/NĐ-CP quy định mức lương cơ sở áp dụng đối với cán bộ, công chức, viên chức, người hưởng lương, phụ cấp và người lao động làm việc trong các cơ quan, tổ chức, đơn vị sự nghiệp của Đảng, Nhà nước, tổ chức chính trị - xã hội và hội được ngân sách nhà nước hỗ trợ kinh phí hoạt động ở Trung ương, ở tỉnh, thành phố trực thuộc Trung ương, ở huyện, quận, thị xã, thành phố thuộc tỉnh, thành phố thuộc thành phố trực thuộc Trung ương (cấp huyện), ở xã, phường, thị trấn (cấp xã), ở đơn vị hành chính - kinh tế đặc biệt và lực lượng vũ trang.</p><p>Có 9 nhóm đối tượng được xếp hưởng mức lương, phụ cấp theo Nghị định này. Mức lương cơ sở được dùng làm căn cứ tính mức lương trong các bảng lương, mức phụ cấp và thực hiện các chế độ khác; tính mức hoạt động phí, sinh hoạt phí theo quy định của pháp luật; tính các khoản trích và các chế độ được hưởng theo mức lương cơ sở.</p><div class=\"VCSortableInPreviewMode IMSCurrentEditorEditObject\" type=\"Photo\"><div><img alt=\"(Ảnh minh hoạ)\" data-original=\"https://dantricdn.com/2017/tang-luong-1-1493210456953.jpg\" h=\"312\" id=\"img_93349\" photoid=\"93349\" rel=\"https://dantricdn.com/2017/tang-luong-1-1493210456953.jpg\" src=\"https://dantricdn.com/2017/tang-luong-1-1493210456953.jpg\" style=\"max-width: 100%; width: 460px;\" type=\"photo\" w=\"500\" /></div><div class=\"PhotoCMS_Caption\">(Ảnh minh hoạ)</div></div><p>Nghị định nêu rõ, mức lương cơ sở được điều chỉnh trên cơ sở khả năng ngân sách nhà nước, chỉ số giá tiêu dùng và tốc độ tăng trưởng kinh tế của đất nước.</p>','Lương công chức, viên chức chính thức tăng từ 1/7/2017','full_html');
/*!40000 ALTER TABLE `block_custom` ENABLE KEYS */;
UNLOCK TABLES;

