INSERT INTO `node_type` VALUES ('article','Article','node_content','node','Use <em>articles</em> for time-sensitive content like news, press releases or blog posts.','',1,'Title',1,1,0,0,'article'),('long_answer','Long answer question','quiz_question','quiz_question','Quiz questions that allow a user to enter multiple paragraphs of text.','',1,'Title',0,0,1,0,'long_answer'),('matching','Matching','quiz_question','quiz_question','Matching question type for quiz module. A question type for the quiz module: allows you to create matching type questions, which connect terms with one another.','',1,'Title',0,0,1,0,'matching'),('multichoice','Multiple choice question','quiz_question','quiz_question','This provides multiple choice questions for use by the Quiz module.','',1,'Title',0,0,1,0,'multichoice'),('page','Basic page','node_content','node','Use <em>basic pages</em> for your static content, such as an \'About us\' page.','',1,'Title',1,1,0,0,'page'),('quiz','Quiz','quiz','quiz','Create interactive quizzes for site visitors','',1,'Title',0,0,1,0,'quiz'),('quiz_directions','Quiz directions','quiz_question','quiz_question','Quiz directions allow you to drop in directions anywhere in a quiz. You can also use them to insert a confirmation step at the end of the quiz.','',1,'Title',0,0,1,0,'quiz_directions'),('quiz_page','Quiz page','quiz_question','quiz_question','Quiz pages allow you display questions across multiple pages.','',1,'Title',0,0,1,0,'quiz_page'),('scale','Scale question','quiz_question','quiz_question','Quiz questions that allow a user to choose from a scale.','',1,'Title',0,0,1,0,'scale'),('short_answer','Short answer question','quiz_question','quiz_question','Quiz questions that allow a user to enter a line of text.','',1,'Title',0,0,1,0,'short_answer'),('truefalse','True/false question','quiz_question','quiz_question','Quiz questions that allow a user to select \"true\" or \"false\" as his response to a statement.','',1,'Title',0,0,1,0,'truefalse'),('webform','Webform','node_content','node','Create a new form or questionnaire accessible to users. Submission results and statistics are recorded and accessible to privileged users.','',1,'Title',1,1,0,0,'webform');
